@blackout_vx @OfficialDabier @Twitch You are 100% right. It will change the tone of the game.

It's not perfect or ideal. But it keeps things legal in an easy way.

The alternative is like you said, Twitch or the streaming pays for a license to stream it.

@blackout_vx @OfficialDabier @Twitch It makes the most sense for them to switch those assets on/off when streaming using the consoles built in capabilities.

Some games already do this.

I am just saying that's the best way and most convenient for the consumer.

@blackout_vx @OfficialDabier @Twitch You misunderstand.

Playstation 4/5. Xbox One/Series X provides point and click streaming capability and even an api to disable it in whole or part by a game.

The makers of the game know the licensing rights to the assets they bought and used to make the game.
